INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(2, 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', 'Bệnh viện Hữu nghị Việt Đức', '**GIỚI THIỆU**\n\n**Địa chỉ**:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n\nSố 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\n\nThời gian làm việc: Thứ 2 đến thứ 7\n\nSáng: 7h00 - 12h00\n\nChiều: 13h30 - 16h30\n\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. ', '<p><strong>GIỚI THIỆU</strong></p>\n<p><strong>Địa chỉ</strong>:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<p>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</p>\n<p>Thời gian làm việc: Thứ 2 đến thứ 7</p>\n<p>Sáng: 7h00 - 12h00</p>\n<p>Chiều: 13h30 - 16h30</p>\n<p>Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n', 'data:image/jpeg;base64,', '2023-10-24 21:50:03', '2023-10-24 21:50:03');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(3, '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', 'Bệnh viện Chợ Rẫy', '\n### GIỚI THIỆU\n\n\nBệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\n**Địa chỉ bệnh viện:**\n\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\n**Thời gian làm việc:**\n\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n\n* Thứ 2 đến thứ 6: từ 7h – 16h\n\n* Thứ 7: từ 7h – 11h', '<h3>GIỚI THIỆU</h3>\n<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p><strong>Địa chỉ bệnh viện:</strong></p>\n<p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p>Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<ul>\n<li>\n<p>Thứ 2 đến thứ 6: từ 7h – 16h</p>\n</li>\n<li>\n<p>Thứ 7: từ 7h – 11h</p>\n</li>\n</ul>\n', 'data:image/jpeg;base64,', '2023-10-24 21:51:29', '2023-10-24 21:51:29');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(4, '20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM', 'Phòng khám Bệnh viện Đại học Y Dược 1', '\n### GIỚI THIỆU\n\nPhòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.\n\nCác bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.\n\nHơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình phải kể đến như: Máy chụp MRI, Máy chụp CT-Scanner, Máy đo loãng xương, các loại máy đo chức năng hô hấp,.... Vì vậy, phòng khám được rất nhiều người bệnh tin tưởng thăm khám.\n\n**Địa chỉ:** 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh\n\n**Thời gian làm việc**\n\n* Thứ 2 tới thứ 6: 07h30 - 16h30\n\n* Thứ 7: 07h30 - 12h00', '<h3>GIỚI THIỆU</h3>\n<p>Phòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.</p>\n<p>Các bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.</p>\n<p>Hơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình phải kể đến như: Máy chụp MRI, Máy chụp CT-Scanner, Máy đo loãng xương, các loại máy đo chức năng hô hấp,.... Vì vậy, phòng khám được rất nhiều người bệnh tin tưởng thăm khám.</p>\n<p><strong>Địa chỉ:</strong> 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc</strong></p>\n<ul>\n<li>\n<p>Thứ 2 tới thứ 6: 07h30 - 16h30</p>\n</li>\n<li>\n<p>Thứ 7: 07h30 - 12h00</p>\n</li>\n</ul>\n', 'data:image/jpeg;base64,', '2023-10-24 21:52:46', '2023-10-24 21:52:46');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(5, 'Số 1B Trần Hưng Đạo, Quận Hai Bà Trưng, Hà Nội', ' Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', '\n### GIỚI THIỆU\n\n**Trung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108** là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.\n\nVì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:\n\n* Được thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.\n* Được khám với quy trình khép kín, không phải di chuyển nhiều.\n* Được tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.\n* Khu vực khám riêng tư, lịch sự.\n* Được lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.\n\n* Tất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\n\n**Địa chỉ:**Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108\n\n**Thời gian làm việc**:\n\n* 6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)\n\n* Khám cá nhân: Thứ 2 - Thứ 6\n\n* Khám đoàn và công ty: Thứ 7', '<h3>GIỚI THIỆU</h3>\n<p><strong>Trung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108</strong> là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.</p>\n<p>Vì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:</p>\n<ul>\n<li>\n<p>Được thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.</p>\n</li>\n<li>\n<p>Được khám với quy trình khép kín, không phải di chuyển nhiều.</p>\n</li>\n<li>\n<p>Được tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.</p>\n</li>\n<li>\n<p>Khu vực khám riêng tư, lịch sự.</p>\n</li>\n<li>\n<p>Được lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.</p>\n</li>\n<li>\n<p>Tất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.</p>\n</li>\n</ul>\n<p>**Địa chỉ:**Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108</p>\n<p><strong>Thời gian làm việc</strong>:</p>\n<ul>\n<li>\n<p>6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)</p>\n</li>\n<li>\n<p>Khám cá nhân: Thứ 2 - Thứ 6</p>\n</li>\n<li>\n<p>Khám đoàn và công ty: Thứ 7</p>\n</li>\n</ul>\n', 'data:image/jpeg;base64,', '2023-10-24 21:54:49', '2023-10-24 21:54:49');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(6, '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', 'Bệnh viện Ung bướu Hưng Việt', '\n### GIỚI THIỆU\n\n**Địa chỉ:** Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội\n\n**Thời gian làm việc**: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)\n\n* Buổi sáng: 07h00 - 12h00\n* Buổi chiều: 13h30 - 17h00\n\nBệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế. \n\nĐiểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.\n\nSự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.', '<h3>GIỚI THIỆU</h3>\n<p><strong>Địa chỉ:</strong> Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội</p>\n<p><strong>Thời gian làm việc</strong>: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)</p>\n<ul>\n<li>Buổi sáng: 07h00 - 12h00</li>\n<li>Buổi chiều: 13h30 - 17h00</li>\n</ul>\n<p>Bệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế.</p>\n<p>Điểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.</p>\n<p>Sự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.</p>\n', 'data:image/jpeg;base64,', '2023-10-24 21:55:45', '2023-10-24 21:55:45');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(7, '42 Nghĩa Dũng, Phúc xá, Ba Đình, Hà Nội', 'Hệ thống y tế MEDLATEC', '\n### GIỚI THIỆU CHUNG\n\nHệ thống y tế MEDLATEC bao gồm 01 Bệnh viện Đa khoa, 07 Phòng khám Đa khoa, 33 chi nhánh, 29 văn phòng, 50 điểm thu gom mẫu trên toàn quốc:\n\n* Bệnh viện Đa khoa MEDLATEC tại 42-44 Nghĩa Dũng, Ba Đình, Hà Nội\n* Phòng khám Đa khoa MEDLATEC Tây Hồ\n* Phòng khám Đa khoa MEDLATEC Thanh Xuân\n* Phòng khám Đa khoa MEDLATEC Vĩnh Phúc\n* Phòng khám Đa khoa MEDLATEC Mê Linh\n* Phòng khám Đa khoa MEDLATEC Bắc Ninh\n* Phòng khám Đa khoa MEDLATEC Thanh Hóa\n* Phòng khám Đa khoa MEDLATEC Cần Thơ\n* Các chi nhánh, văn phòng, điểm thu gom mẫu\n\n**Bệnh viện Đa khoa MEDLATEC**\n\n**Địa chỉ:** 42 Nghĩa Dũng, Ba Đình, Hà Nội.\n\n**Thời gian làm việc: **Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\n\n**Các dịch vụ y tế cung cấp:**\n\n* Khám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\n* Phẫu thuật hoặc tiểu phẫu: Phẫu thuật Ung bướu, phẫu thuật Tiêu hóa, phẫu thuật Tiết niệu, phẫu thuật Nam khoa, phẫu thuật chấn thương. Điều trị tại viện: Dịch vụ đốt sóng cao tần điều trị u lành tuyến giáp.\n* Đáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, MRI, CT-Scanner), thăm dò chức năng (Điện tim, Nội soi,…), xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử, Giải phẫu bệnh, Vi sinh…)\n* Khám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.\n* Khám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…\n* Khám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc.\n* Tiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai,...', '<h3>GIỚI THIỆU CHUNG</h3>\n<p>Hệ thống y tế MEDLATEC bao gồm 01 Bệnh viện Đa khoa, 07 Phòng khám Đa khoa, 33 chi nhánh, 29 văn phòng, 50 điểm thu gom mẫu trên toàn quốc:</p>\n<ul>\n<li>Bệnh viện Đa khoa MEDLATEC tại 42-44 Nghĩa Dũng, Ba Đình, Hà Nội</li>\n<li>Phòng khám Đa khoa MEDLATEC Tây Hồ</li>\n<li>Phòng khám Đa khoa MEDLATEC Thanh Xuân</li>\n<li>Phòng khám Đa khoa MEDLATEC Vĩnh Phúc</li>\n<li>Phòng khám Đa khoa MEDLATEC Mê Linh</li>\n<li>Phòng khám Đa khoa MEDLATEC Bắc Ninh</li>\n<li>Phòng khám Đa khoa MEDLATEC Thanh Hóa</li>\n<li>Phòng khám Đa khoa MEDLATEC Cần Thơ</li>\n<li>Các chi nhánh, văn phòng, điểm thu gom mẫu</li>\n</ul>\n<p><strong>Bệnh viện Đa khoa MEDLATEC</strong></p>\n<p><strong>Địa chỉ:</strong> 42 Nghĩa Dũng, Ba Đình, Hà Nội.</p>\n<p>**Thời gian làm việc: **Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.</p>\n<p><strong>Các dịch vụ y tế cung cấp:</strong></p>\n<ul>\n<li>Khám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...</li>\n<li>Phẫu thuật hoặc tiểu phẫu: Phẫu thuật Ung bướu, phẫu thuật Tiêu hóa, phẫu thuật Tiết niệu, phẫu thuật Nam khoa, phẫu thuật chấn thương. Điều trị tại viện: Dịch vụ đốt sóng cao tần điều trị u lành tuyến giáp.</li>\n<li>Đáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, MRI, CT-Scanner), thăm dò chức năng (Điện tim, Nội soi,…), xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử, Giải phẫu bệnh, Vi sinh…)</li>\n<li>Khám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.</li>\n<li>Khám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…</li>\n<li>Khám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc.</li>\n<li>Tiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai,...</li>\n</ul>\n', 'data:image/png;base64,', '2023-10-24 21:57:44', '2023-10-24 21:57:44');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(8, '414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh', 'Trung tâm xét nghiệm Diag Laboratories', 'GIỚI THIỆU CHUNG\nDiag là một trong những trung tâm xét nghiệm uy tín tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.\n\n* Dàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác.\n* Sử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu.\n* Danh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe.\n* Mạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\n* Các kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC) giúp quá trình xét nghiệm và trả kết quả được chính xác.\n* Trung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động hiện đại của hãng Abbott. Các trang thiết bị khác của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Roche, Sysmex, Thermo Fisher, Arkray.\n\n\n**Địa chỉ:** Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh\n\n\nTrung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\n\n**Thời gian làm việc:**\n\nGiờ mở cửa: 6h00 mỗi ngày\n\nGiờ đóng cửa: \n\n* Thứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)\n\n* Chủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở), cơ sở Quận 10: 19h00', '<p>GIỚI THIỆU CHUNG\nDiag là một trong những trung tâm xét nghiệm uy tín tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.</p>\n<ul>\n<li>Dàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác.</li>\n<li>Sử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu.</li>\n<li>Danh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe.</li>\n<li>Mạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.</li>\n<li>Các kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC) giúp quá trình xét nghiệm và trả kết quả được chính xác.</li>\n<li>Trung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động hiện đại của hãng Abbott. Các trang thiết bị khác của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Roche, Sysmex, Thermo Fisher, Arkray.</li>\n</ul>\n<p><strong>Địa chỉ:</strong> Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh</p>\n<p>Trung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p>Giờ mở cửa: 6h00 mỗi ngày</p>\n<p>Giờ đóng cửa:</p>\n<ul>\n<li>\n<p>Thứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)</p>\n</li>\n<li>\n<p>Chủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở), cơ sở Quận 10: 19h00</p>\n</li>\n</ul>\n', 'data:image/png;base64,', '2023-10-24 21:59:17', '2023-10-24 21:59:17');
