(1, '<p><strong>Bác sĩ Chuyên khoa II Trần Minh Khuyên</strong>\n666 Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên\nQuá trình đào tạo\nTốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\nHọc chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\nQuá trình công tác\nNguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\nNguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\nGiám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</p>\n', '**Bác sĩ Chuyên khoa II Trần Minh Khuyên**\n666 Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên\nQuá trình đào tạo\nTốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\nHọc chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\nQuá trình công tác\nNguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\nNguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\nGiám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 26, NULL, NULL, '2023-10-10 10:57:17', '2023-10-11 20:04:37'),
(2, '<h2>Bác sĩ Jennie Hui Mina</h2>\n<ul>\n<li>\n<p>Bác sĩ tư vấn dinh dưỡng cho phụ nữ mang thai và trẻ em</p>\n</li>\n<li>\n<p>Nhiều năm kinh nghiệm trong lĩnh vực Tư vấn dinh dưỡng</p>\n</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>Hiện là Bác sĩ khám và điều trị, Bệnh viện Đa khoa Bảo Sơn</li>\n</ul>\n<h3><strong>Quá trình đào tạo</strong></h3>\n<ul>\n<li>\n<p>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y Hà Nội</p>\n</li>\n<li>\n<p>Chứng chỉ Dinh dưỡng lâm sàng và điều trị, Viện dinh dưỡng quốc gia</p>\n</li>\n</ul>\n<h3><strong>Khám và điều trị</strong></h3>\n<ul>\n<li>\n<p>Tư vấn dinh dưỡng cho phụ nữ mang thai, phụ nữ sau sinh</p>\n</li>\n<li>\n<p>Tư vấn dinh dưỡng cho trẻ từ 0 – 5 tuổi, giai đoạn sơ sinh, ăn dặm</p>\n</li>\n<li>\n<p>Tư vấn dinh dưỡng cho phụ nữ mắc đái tháo đường thai kỳ, tăng/sụt cân trong thời kỳ mang thai, thiếu vi chất…</p>\n</li>\n</ul>\n<p><strong>Một vài hình ảnh về phòng khám bệnh của bác sĩ</strong>\n<img src=\"https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/46195.jpg?raw=true\" alt=\"img\"></p>\n', '\n## Bác sĩ Jennie Hui Mina\n\n\n* Bác sĩ tư vấn dinh dưỡng cho phụ nữ mang thai và trẻ em\n\n* Nhiều năm kinh nghiệm trong lĩnh vực Tư vấn dinh dưỡng\n\n\n### **Quá trình công tác**\n\n* Hiện là Bác sĩ khám và điều trị, Bệnh viện Đa khoa Bảo Sơn\n\n\n### **Quá trình đào tạo**\n\n\n* Tốt nghiệp Bác sĩ Đa khoa, Đại học Y Hà Nội\n\n* Chứng chỉ Dinh dưỡng lâm sàng và điều trị, Viện dinh dưỡng quốc gia\n\n\n### **Khám và điều trị**\n\n\n* Tư vấn dinh dưỡng cho phụ nữ mang thai, phụ nữ sau sinh\n\n* Tư vấn dinh dưỡng cho trẻ từ 0 – 5 tuổi, giai đoạn sơ sinh, ăn dặm\n\n* Tư vấn dinh dưỡng cho phụ nữ mắc đái tháo đường thai kỳ, tăng/sụt cân trong thời kỳ mang thai, thiếu vi chất…\n\n**Một vài hình ảnh về phòng khám bệnh của bác sĩ**\n![img](https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/46195.jpg?raw=true)', 'Bác sĩ tư vấn dinh dưỡng cho phụ nữ mang thai và trẻ em\nNhiều năm kinh nghiệm trong lĩnh vực Tư vấn dinh dưỡng', 32, NULL, NULL, '2023-10-11 20:19:05', '2023-10-17 11:48:16');
