INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(2, 'data:image/jpeg;base64,', 'Cơ xương khớp', '<h2>Cơ Xương Khớp</h2>\n<h5>Bác sĩ Cơ Xương Khớp giỏi</h5>\n<p>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</p>\n<p>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</p>\n<p>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.</p>\n<p>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...</p>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</p>\n<h5>Bệnh Cơ Xương Khớp</h5>\n<p>Gout</p>\n<p>Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</p>\n<p>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</p>\n<p>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</p>\n<p>Loãng xương, đau nhức xương</p>\n<p>Viêm xương, gai xương</p>\n<p>Viêm cơ, Teo cơ, chứng đau mỏi cơ</p>\n<p>Yếu cơ, Loạn dưỡng cơ</p>\n<p>Các chấn thương về cơ, xương, khớp</p>\n<p>...</p>\n', '## Cơ Xương Khớp\n##### Bác sĩ Cơ Xương Khớp giỏi\nDanh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:\n\nCác chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm\n\nCác giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội\n\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.\n\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...\n\nĐược nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n##### Bệnh Cơ Xương Khớp\nGout\n\nThoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ\n\nViêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n\nTràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai\n\nLoãng xương, đau nhức xương\n\nViêm xương, gai xương\n\nViêm cơ, Teo cơ, chứng đau mỏi cơ\n\nYếu cơ, Loạn dưỡng cơ\n\nCác chấn thương về cơ, xương, khớp\n\n...', '2023-10-23 12:18:22', '2023-10-23 12:18:22');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(3, 'data:image/jpeg;base64,', 'Thần kinh', '<h2>Thần kinh</h2>\n<h4>Bác sĩ Thần kinh giỏi</h4>\n<h5>Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</h5>\n<p>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.</p>\n<p>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</p>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</p>\n<h5>Khám bệnh chuyên khoa Thần kinh</h5>\n<p>Bại Não</p>\n<p>Đau đầu, chóng mặt, buồn nôn</p>\n<p>Bệnh Pakison, bệnh tiền đình</p>\n<p>Bị co cơ, căng dây thần kinh</p>\n<p>Động kinh, có những cơn vãng ý thức</p>\n<p>Bị tê bì nửa mặt, chèn dây thần kinh</p>\n<p>Bồn chồn, lo lắng, hồi hộp, chân tay run</p>\n<p>Có dấu hiệu tăng động</p>\n<p>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi</p>\n<p>Chấn thương đầu, dây thần kinh</p>\n<p>...</p>\n', '## Thần kinh\n#### Bác sĩ Thần kinh giỏi\n##### Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:\n\nCác giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.\n\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\n\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\n##### Khám bệnh chuyên khoa Thần kinh\n\nBại Não   \n\nĐau đầu, chóng mặt, buồn nôn   \n\nBệnh Pakison, bệnh tiền đình   \n\nBị co cơ, căng dây thần kinh       \n\nĐộng kinh, có những cơn vãng ý thức   \n\nBị tê bì nửa mặt, chèn dây thần kinh\n\nBồn chồn, lo lắng, hồi hộp, chân tay run   \n\nCó dấu hiệu tăng động    \n\nCo rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   \n\nChấn thương đầu, dây thần kinh\n\n...', '2023-10-23 12:20:04', '2023-10-23 12:20:04');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(4, 'data:image/jpeg;base64,', 'Tiêu hóa', '<h3>Tiêu hoá</h3>\n<h4>Bác sĩ Chuyên khoa Tiêu hóa</h4>\n<p>Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội</p>\n<p>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</p>\n<p>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...</p>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</p>\n<h5>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</h5>\n<p>Ăn uống kém, không ngon</p>\n<p>Rối loạn tiêu hóa, táo bón, trĩ</p>\n<p>Nhiễm vi khuẩn HP (Helicobacter pylori)</p>\n<p>Nội soi dạ dày, đại tràng, tiêu hóa</p>\n<p>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</p>\n<p>Co thắt thực quản, Hội chứng ruột kích thích</p>\n<p>Đau bụng, dạ dày, đại tràng, thượng vị</p>\n<p>Viêm đại tràng, dạ dày, tá tràng</p>\n<p>Ung thư dạ dày, U nang tuyến tụy</p>\n<p>Bệnh lý về gan, mật</p>\n', '### Tiêu hoá\n#### Bác sĩ Chuyên khoa Tiêu hóa\nDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\n\nCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\n\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n\n##### Tư vấn, khám và điều trị các Bệnh Tiêu hóa\n\nĂn uống kém, không ngon\n\nRối loạn tiêu hóa, táo bón, trĩ\n\nNhiễm vi khuẩn HP (Helicobacter pylori)\n\nNội soi dạ dày, đại tràng, tiêu hóa\n\nBuồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\n\nCo thắt thực quản, Hội chứng ruột kích thích\n\nĐau bụng, dạ dày, đại tràng, thượng vị\n\nViêm đại tràng, dạ dày, tá tràng\n\nUng thư dạ dày, U nang tuyến tụy\n\nBệnh lý về gan, mật', '2023-10-23 12:21:21', '2023-10-23 12:21:21');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(5, 'data:image/jpeg;base64,', 'Tim mạch', '<h2>Tim mạch</h2>\n<h5>Bác sĩ tim mạch giỏi</h5>\n<p>Danh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.</p>\n<p>Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội</p>\n<p>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội</p>\n<p>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\nĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</p>\n<h5>Khám tư vấn tim mạch</h5>\n<p>Khó thở, Đau ngực, đau tim</p>\n<p>Tăng huyết áp, hạ huyết áp</p>\n<p>Rối loạn mỡ máu, cao huyết áp, chóng mặt</p>\n<p>Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ</p>\n<p>Cảm giác hồi hộp, tim đập nhanh</p>\n<p>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến</p>\n<p>Đã đặt stent tim, nong động mạch vành</p>\n<p>Giãn tĩnh mạch chân</p>\n<p>...</p>\n', '## Tim mạch\n##### Bác sĩ tim mạch giỏi\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\n\nCác giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\n\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\n\nLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\nĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n##### Khám tư vấn tim mạch\n\nKhó thở, Đau ngực, đau tim\n\nTăng huyết áp, hạ huyết áp\n\nRối loạn mỡ máu, cao huyết áp, chóng mặt\n\nBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\n\nCảm giác hồi hộp, tim đập nhanh   \n\nTim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến   \n\nĐã đặt stent tim, nong động mạch vành\n\nGiãn tĩnh mạch chân   \n\n...', '2023-10-23 12:23:10', '2023-10-23 12:23:10');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(6, 'data:image/jpeg;base64,', 'Tai mũi họng', '<h2>Tai Mũi Họng</h2>\n<h5>Bác sĩ Chuyên khoa Tai Mũi Họng</h5>\n<h5>Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</h5>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội</p>\n<p>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</p>\n<p>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...</p>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...</p>\n<h5>Các bệnh Tai Mũi Họng</h5>\n<p>Ù tai, đau tai, chảy máu tai</p>\n<p>Thủng màng nhĩ, điếc đột ngột</p>\n<p>Viêm tai giữa</p>\n<p>Amidan, V.A</p>\n<p>Viêm xoang</p>\n<p>Nghẹt mũi</p>\n<p>Hay bị chảy máu cam</p>\n<p>Đau cổ họng, khó nuốt</p>\n<p>Ho kéo dài</p>\n<p>Ngủ ngáy</p>\n<p>...</p>\n', '## Tai Mũi Họng\n##### Bác sĩ Chuyên khoa Tai Mũi Họng\n##### Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội\n\nCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n\nCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...\n\nĐược nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...\n##### Các bệnh Tai Mũi Họng\n\nÙ tai, đau tai, chảy máu tai\n\nThủng màng nhĩ, điếc đột ngột\n\nViêm tai giữa\n\nAmidan, V.A\n\nViêm xoang\n\nNghẹt mũi\n\nHay bị chảy máu cam\n\nĐau cổ họng, khó nuốt\n\nHo kéo dài\n\nNgủ ngáy\n\n...', '2023-10-23 12:24:06', '2023-10-23 12:24:06');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(7, 'data:image/jpeg;base64,', 'Cột sống', '<h2>Cột sống</h2>\n<h5>Bác sĩ Chuyên khoa Cột sống</h5>\n<p>Danh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội</p>\n<p>Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.</p>\n<p>Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...</p>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</p>\n<h5>Bệnh Thần kinh - Cột sống</h5>\n<p>Đau cột sống, đau thắt lưng</p>\n<p>Chấn thương cột sống</p>\n<p>Cột sống bị đau, sưng, cong, vẹo</p>\n<p>Đau mỏi cổ vai gáy, bả vai</p>\n<p>Đau tê mông xuống chân</p>\n<p>Phồng đĩa đệm</p>\n<p>Tê bì tay chân</p>\n<p>Thóa hóa đốt sống</p>\n<p>Thoái hóa L4, L5</p>\n<p>Thoát vị đĩa đệm</p>\n<p>Vôi hóa cột sống</p>\n<p>Xẹp cột sống</p>\n<p>...</p>\n', '## Cột sống\n##### Bác sĩ Chuyên khoa Cột sống\nDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội\n\nCác giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.\n\nCác bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...\n\nĐược nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n##### Bệnh Thần kinh - Cột sống\n\nĐau cột sống, đau thắt lưng\n\nChấn thương cột sống\n\nCột sống bị đau, sưng, cong, vẹo\n\nĐau mỏi cổ vai gáy, bả vai\n\nĐau tê mông xuống chân\n\nPhồng đĩa đệm\n\nTê bì tay chân\n\nThóa hóa đốt sống\n\nThoái hóa L4, L5\n\nThoát vị đĩa đệm\n\nVôi hóa cột sống\n\nXẹp cột sống\n\n...', '2023-10-23 12:24:58', '2023-10-23 12:24:58');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(8, 'data:image/jpeg;base64,', 'Y học cổ truyền', '<h2>Y học Cổ truyền</h2>\n<h5>Bác sĩ Y học Cổ truyền giỏi</h5>\n<p>Danh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</p>\n<p>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</p>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</p>\n<h5>Tư vấn, khám và điều trị các vấn đề:</h5>\n<p>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh..</p>\n<p>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</p>\n<p>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</p>\n<p>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</p>\n', '## Y học Cổ truyền\n##### Bác sĩ Y học Cổ truyền giỏi\nDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\n\nCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\n\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\n\n##### Tư vấn, khám và điều trị các vấn đề:\n\nBệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh..\n\nBệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\n\nBệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\n\nBệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', '2023-10-23 12:25:54', '2023-10-23 12:25:54');
INSERT INTO "Specialties" ("id", "image", "name", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(9, 'data:image/jpeg;base64,', 'Châm cứu', '<h2>Châm cứu</h2>\n<h5>Bác sĩ Châm cứu giỏi</h5>\n<h5>Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</h5>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</p>\n<p>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</p>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</p>\n<h5>Tư vấn, khám và điều trị các vấn đề:</h5>\n<p>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</p>\n<p>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</p>\n<p>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</p>\n<p>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</p>\n', '## Châm cứu\n##### Bác sĩ Châm cứu giỏi\n\n##### Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\n\nCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\n\nĐược nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\n\n##### Tư vấn, khám và điều trị các vấn đề:\n\nBệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\n\nBệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\n\nBệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\n\nBệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...\n', '2023-10-23 12:26:33', '2023-10-23 12:26:33');
